import React, { Component } from 'react'
import './css/ScoreBar.css'

class ScoreBar extends Component{

    constructor(props){
        super(props)
    }

    render(){
        return(
            <progress children={<span id="proba"></span>} id="progress"></progress>
        )
    }
}

export default ScoreBar
